DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
                            `menu_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
                            `menu_name` varchar(50) NOT NULL COMMENT '',
