                            `visible` char(1) DEFAULT '0' COMMENT '0 1',
                            `status` char(1) DEFAULT '0' COMMENT '0 1',
                            `perms` varchar(100) DEFAULT NULL COMMENT '',
                            `icon` varchar(100) DEFAULT '#' COMMENT '',
                            `create_by` varchar(64) DEFAULT '' COMMENT '',
